const logo128 = "data:image/png;base64,";
const create_logo = "data:image/png;base64,";
const update_logo = "data:image/png;base64,";
const delete_logo = "data:image/png;base64,";
const access_logo = "data:image/png;base64,";
// Mapping element IDs to their corresponding logo variables
const elements = [
    { id: "logo_leftcorner", logo: logo128 },

    { id: "img_audittoday", logo: logo128 },
    { id: "img_auditadvfind", logo: logo128 },
    { id: "img_auditcenter", logo: logo128 },
    { id: "img_plugintraces", logo: logo128 },
    { id: "img_solutions", logo: logo128 },
    { id: "img_users_last_login_link", logo: logo128 },
    { id: "create_logo", logo: create_logo },
    { id: "update_logo", logo: update_logo },
    { id: "delete_logo", logo: delete_logo },
    { id: "access_logo", logo: access_logo }
];

// Loop through each element and update its src if it exists
elements.forEach(item => {
    const element = document.getElementById(item.id);
    if (element) {  // Only set src if the element exists
        element.src = item.logo;
    }
});
console.info("XWT: All images updated successfully");


